Having regard to the Treaty establishing the European Economic Community, and in particular Articles 43 and 113 thereof,
Having regard to the proposal from the Commission,
Having regard to the opinion of the European Parliament (1),
Whereas Regulations (EEC) No 3831/90 (2), (EEC) No 3832/90 (3) and (EEC) No 3833/90 (4), extended by Regulation (EEC) No 3587/91 (5), provide for the Community generalized tariff preferences scheme to be applied to certain products originating in  Hungary, Poland and Czechoslovakia;
Whereas Regulation (EEC) No 3834/90 (6), extended by Regulation (EEC) No 3588/91 (7), provides for a reduction of the levy applicable to certain agricultural products originating in particular in Hungary, Poland and Czechoslovakia;
Whereas the interim agreements on trade and related matters concluded by the Community with the Republic of Hungary (8), the Republic of Poland (9) and the Czech and Slovak Federal Republic (10) respectively entered into force on 1 March 1992;
Whereas the Community generalized tariff preferences will no longer apply to these countries as from that date and these countries should therefore be withdrawn from the lists of beneficiaries and the volume of the fixed amounts within which a reduced  levy is applied should be adapted,
